import React, { Component } from 'react'
import "../css/items.min.css"
class Item extends Component {
    render() {
        return (
            <div className="itemcontainer">
                <div className="itemcontainer__breadcrumb">
                    gdfgdfgdfgfd
                </div>
                <div className="itemcontainer__image">
                    <img src="http://127.0.0.1:8000/media/images/products/2020/04/comment_1585833501ebRJtT9QtFnOtHOYsLnY2Uw400_WPTEc5r.jpg"></img>
                </div>
                <div className="itemcontainer__order__information">
                    ertrgdf
                </div>
                
            </div>
        )
    }
}
export default Item;
